INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 0, "リン", 24, 1, 10040, 0.0, 1, 0.0, "2020/04/30 12:00:00", 24001, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, "リン", 24, 1, 10040, 0.0, 1, 0.0, "2020/04/30 12:00:00", 24002, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 2, "リン", 24, 1, 10040, 0.0, 1, 0.0, "2020/04/30 12:00:00", 24003, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 3, "リン", 24, 2, 10040, 0.0, 2, 0.0, "2020/04/30 12:00:00", 24004, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 4, "リン", 24, 1, 10040, 0.0, 1, 0.0, "2020/04/30 12:00:00", 24005, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 5, "リン", 24, 2, 10040, 0.0, 2, 0.0, "2020/04/30 12:00:00", 24006, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 6, "リン", 24, 2, 10040, 0.0, 2, 0.0, "2020/04/30 12:00:00", 24007, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 7, "リン", 24, 4, 10040, 0.0, 4, 0.0, "2020/04/30 12:00:00", 24008, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 8, "リン", 24, 4, 10040, 0.0, 4, 0.0, "2020/04/30 12:00:00", 24009, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 9, "リン", 24, 4, 10040, 0.0, 4, 0.0, "2020/04/30 12:00:00", 24010, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 10, "リン", 24, 4, 10040, 0.0, 4, 0.0, "2020/04/30 12:00:00", 24011, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 11, "リン", 24, 4, 10040, 0.0, 4, 0.0, "2020/04/30 12:00:00", 24012, 0.0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 12, "リン", 24, 4, 10040, 0.0, 1, 0.0, "2020/04/30 12:00:00", 24013, 1.81, 102601);
